INSERT INTO cck_activity VALUES (5, 'ru', 4, NULL, 'Строительно-монтажные работы', 'строительно-монтажные работы', 'Организация выполнения строительно-монтажных работ любого уровня на жилых и нежилых объектах недвижимости Москвы и Московской области', 'Строительно-монтажные работы', 'Строительство', '', 'stroitelno-montazhnye-raboty', true, NULL, false, '2015-12-22 18:24:32.15896+03', '2016-03-03 00:10:42.67609+03', '<ul class="push">

    <li>общестроительные работы;</li>

    <li>отделочные работы;</li>

    <li>монолитные работы;</li>

    <li>строительство и перекладка инженерных сетей и сооружений;</li>

    <li>дорожное строительство;</li>

    <li>снос зданий;</li>

    <li>рекультивация территорий застройки;</li>

    <li>монтаж внутренних инженерных систем;</li>

    <li>монтаж слаботочных и охраннопожарных систем;</li>

    <li>дизайнерская отделка помещений.</li>

</ul>', '{% load cck_activities %}

<p>

    <b>Группа компаний «ССК»</b> выполняет полный спектр <strong>строительно-монтажных работ</strong>, в том числе

    осуществление функций генерального подрядчика.

</p>

<p>

    Современные методы управления проектами и наличие <a href="{% get_activity_url 2 %}">системы контроля управления

    качеством</a> позволяет выполнить поставленные задачи в кратчайшие сроки и с должным качеством.

</p>

<div class="card card-success card-inverse lead  text-justify">

    <div class="card-block">

        <p class="card-text">

            <b>Строительно-монтажные работы</b> проводятся высококвалифицированными и опытными специалистами с высшим

            строительным образованием, которые своевременно проходят курсы повышения квалификации, имеют

            <a href="{% url ''permits:list'' %}">сертификаты соответствия</a>, удостоверяющие, что уровень

            профессионального образования, опыт работы и профессиональные навыки соответствуют занимаемым должностям.

        </p>

    </div>

</div>

<p>

    Использование собственных <a href="{% get_activity_url 6 %}">средств механизации</a> является одним из ключевых

    конкурентных преимуществ Группы.

</p>', 1, 1);
INSERT INTO cck_activity VALUES (6, 'ru', 5, NULL, 'Механизация строительства, дорожные и земляные работы', 'спецтехника, аренда спецтехники', 'Организация мероприятий по механизации строительства, выполнение дорожных и земляных работ любого уровня на крупных жилых и нежилых объектах недвижимости Москвы и Московской области', 'Механизация строительства, дорожные и земляные работы', 'Механизация строительства', '', 'mehanizacziya-stroitelstva-dorozhnye-i-zemlyanye-raboty', true, NULL, false, '2015-12-22 19:03:01.262775+03', '2016-05-16 17:37:02.14019+03', '<ul class="push">

