            <li>Возведение сооружений из обыкновенных и фасонных бетонных массивов;</li>

            <li>Возведение сооружений из оболочек большого диаметра;</li>

            <li>Возведение сооружений на сваях и сваях-оболочках;</li>

            <li>Засыпка пазух причальных набережных;</li>

            <li>Подводная прокладка кабельных линий;</li>

            <li>Подводные переходы трубопроводов через водные преграды.</li>

        </ul>

    </li>

</ul>', 1, 1, 1);
INSERT INTO cck_activity_article VALUES (3, 2, NULL, 'Строительный контроль при монолитных работах', 'строительный контроль, монолитные работы', 'Перечень основных требований строительного контроля при осуществлении монолитных работ на крупных жилых и нежилых объектах недвижимости Москвы и Московской области', 'Строительный контроль <small>при монолитных работах</small>', 'Строительный контроль при монолитных работах', '', 'stroitelnyj-kontrol-pri-monolitnyh-rabotah', true, NULL, false, '2016-02-18 01:38:01.967976+03', '2016-04-12 17:25:07.373728+03', '{% load proj_images %}

<p>

    Инженеру <strong>строительного контроля</strong>, осуществляющему контроль за строительством объектов

    жилищно-гражданского и производственного назначения,по основным видам нарушений при <strong>монолитных

    работах</strong>.

</p>

<h2>Перечень основных строительных нарушений (дефектов) при производстве монолитных работ</h2>

{% with size=''192'' lazy=''canvas'' class=''img-fluid'' lightbox=''stroitelnyj-kontrol'' itemprop=True %}

<table class="table table-condensed">

    <caption>Монолитные бетонные работы</caption>

    <thead>

    <tr>

        <th width="56">№ <br> п/п</th>

        <th>Нарушения обязательных требований нормативных документов в строительстве</th>

        <th width="25%">Ссылки на нормативные документы</th>

        <th width="25%">Фото (образец нарушения)</th>

    </tr>

    </thead>

    <tbody>

    <tr>

        <td>1</td>

        <td>Перед укладкой бетонной смеси не производится очистка горизонтальных и наклонных бетонных поверхностей

            рабочих швов от мусора, масел, снега, льда и др., поверхности не промываются водой и не просушиваются.

        </td>

        <td>СП 70.13330.2012 п.&nbsp;5.3.1 (СНиП 3.03.01-87, п.&nbsp;2.8)</td>

        <td>

            {% with alt=''укладка бетонной смеси без очистки рабочих швов'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/00.jpg'' %}

            {% endwith %}

            {% with alt=''укладка бетонной смеси без промывки водой и просушивания поверхности'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/01.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>2</td>

        <td>Укладка бетонной смеси в конструкции производится не горизонтальными слоями, не одинаковой толщины, с

            разрывами.

        </td>

        <td>СНиП 3.03.01-87, п.&nbsp;2.10 (СП 70.13330.2012 п.&nbsp;5.3.8)</td>

        <td>

            {% with alt=''неравномерная укладка бетонной смеси в конструкции'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/02.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>3</td>

        <td>Укладка бетона следующего слоя бетонной смеси производится на бетон предыдущего слоя, процесс схватывания

            которого начался, верхний уровень уложенной бетонной смеси доходит до верха щитов опалубки менее нормируемых

            значений.

        </td>

        <td>СП 70.13330.2012 п.&nbsp;5.3.9 (СНиП 3.03.01-87, п.&nbsp;2.12)</td>

        <td>

            {% with alt=''укладка бетона следующего слоя производится на бетон предыдущего слоя'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/03.jpg'' %}

            {% endwith %}

            {% with alt=''верхний уровень бетонной смеси доходит до верха опалубки менее нормируемых значений'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/04.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>4</td>

        <td>Поверхность рабочих швов, устраиваемых при укладке бетонной смеси с перерывами, не перпендикулярна оси

            бетонируемых колонн, балок, поверхности плит и стен; расположение рабочих швов не соответствует проекту.

        </td>

        <td>СП 70.13330.2012 п.&nbsp;5.3.12 (СНиП 3.03.01-87, п.&nbsp;2.13)</td>

        <td>

            {% with alt=''расположение рабочих швов не соответствует проекту'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/05.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>5</td>

        <td>Не выполняются требования к укладке и уплотнению бетонных смесей. Движение людей по забетонированным

            конструкциям и установка опалубки вышележащих конструкций производится до достижения бетоном нормируемой

            прочности.

        </td>

        <td>СП 70.13330.2012 п.&nbsp;5.3.13, табл. 5.2 (СНиП 3.03.01-87, п.&nbsp;2.14., табл.&nbsp;2)</td>

        <td>

            {% with alt=''не выполняются требования к укладке и уплотнению бетонных смесей'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/06.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>6</td>

        <td>Движение людей по забетонированным конструкциям и установка опалубки вышележащих конструкций производится до

            достижения бетоном нормируемой прочности.

        </td>

        <td>СП 70.13330.2012 п.&nbsp;5.4.3 (СНиП 3.03.01-87, п.&nbsp;2.17)</td>

        <td>

            {% with alt=''движение людей по забетонированным конструкциям'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/07.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>7</td>

        <td>Не контролируются основные показатели качества бетонной смеси и бетона.</td>

        <td>СП 70.13330.2012 п.&nbsp;5.6.5, табл.&nbsp;5.3 (СНиП 3.03.01-87, п.&nbsp;2.23., табл.&nbsp;3)</td>

        <td>

            {% with alt=''строительный контроль основных показателей качества бетонной смеси и бетона'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/08.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>8</td>

        <td>Состояние основания, на которое укладывается бетонная смесь, а также температура основания и способ укладки

            не исключают возможности замерзания смеси в зоне контакта с основанием; неопалубленные поверхности

            конструкций не укрыты паро- и теплоизоляционными материалами по окончании бетонирования; выпуски арматуры

            забетонированных конструкций не укрыты, не утеплены на нормируемую высоту (длину).

        </td>

        <td>СП 70.13330.2012 п.&nbsp;5.11.5 (СНиП 3.03.01-87, п.&nbsp;2.57)</td>

        <td>

            {% with alt=''не исключена возможность замерзания бетонной смеси в зоне контакта с основанием'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/09.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>9</td>

        <td>Не осуществляется контроль прочности бетона испытаниями образцов, изготовленных у места укладки бетонной

            смеси, либо по температуре бетона в процессе его выдерживания.

        </td>

        <td>СП 70.13330.2012 п.&nbsp;5.5.5 (СНиП 3.03.01-87, п.&nbsp;2.61)</td>

        <td>

            {% with alt=''не осуществляется контроль прочности бетона испытаниями образцов'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/10.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>10</td>

        <td>Не выполняются нормативные требования к производству бетонных работ при отрицательных температурах

            воздуха.

        </td>

        <td>СП 70.13330.2012 п.&nbsp;5.11.16, табл.&nbsp;5.7 (СНиП 3.03.01-87, п.&nbsp;2.62., табл.&nbsp;6)</td>

        <td>

            {% with alt=''не выполняются нормативные требования к производству бетонных работ'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/11.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>11</td>

        <td>Не осуществляется уход за свежеуложенным бетоном после окончания укладки бетонной смеси до достижения

            нормативной прочности при температуре воздуха выше нормируемой температуры.

        </td>

        <td>СП 70.13330.2012 п.&nbsp;5.4.1 (СНиП 3.03.01-87, п.&nbsp;2.66)</td>

        <td>

            {% with alt=''не осуществляется уход за свежеуложенным бетоном'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/12.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>12</td>

        <td>Минимальная прочность бетона при распалубке менее нормативной.</td>

        <td>СП 70.13330.2012 п.&nbsp;5.17.8, табл.&nbsp;5.11 (СНиП 3.03.01-87, п.&nbsp;2.110., табл.&nbsp;10)</td>

        <td>

            {% with alt=''строительный контроль минимальной прочности бетона'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/13.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>13</td>

        <td>Не соблюдены требования, предъявляемые к законченным бетонным и железобетонным конструкциям или частям

            сооружений.

        </td>

        <td>СП 70.13330.2012 п.&nbsp;5.18.3, табл.&nbsp;5.12 (СНиП 3.03.01-87, п.&nbsp;2.113., табл.&nbsp;11)</td>

        <td>

            {% with alt=''не соблюдены требования, предъявляемые к законченным конструкциям'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/14.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>14</td>

        <td>Стыковые и крестообразные сварные соединения выполнены с отступлениями от проекта.</td>

        <td>СП 70.13330.2012 п.&nbsp;5.16.22 (СНиП 3.03.01-87, п.&nbsp;2.103)</td>

        <td>

            {% with alt=''строительный контроль выполнения соединений в соотвесвии с проектом'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/15.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>15</td>

        <td>Превышены предельно допустимые отклонения при устройстве арматурных конструкций.</td>

        <td>СП 70.13330.2012 п.&nbsp;5.16.16, табл.&nbsp;5.10 (СНиП 3.03.01-87, п.&nbsp;2.104., табл.&nbsp;9)</td>

        <td>

            {% with alt=''превышение предельно допустимых отклонений'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/16.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>16</td>

        <td>Сварка арматуры произведена ручной дуговой электросваркой с подрезкой стержней рабочей арматуры.</td>

        <td>ГОСТ 14098-91; п.&nbsp;8.</td>

        <td>

            {% with alt=''строительный контроль сврки арматуры'' %}

            {% thumb ''www/stroitelnyj-kontrol/3/17.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    </tbody>

</table>

{% endwith %}', 1, 1, 1);
INSERT INTO cck_activity_article VALUES (4, 3, NULL, 'Строительный контроль при производстве земляных работ', 'строительный контроль, земляные работы', 'Перечень основных требований строительного контроля при производстве земляных работ на крупных жилых и нежилых объектах недвижимости Москвы и Московской области', 'Строительный контроль <small>при производстве земляных работ</small>', 'Строительный контроль при земляных работах', '', 'stroitelnyj-kontrol-pri-proizvodstve-zemlyanyh-rabot', true, NULL, false, '2016-02-18 01:39:56.145277+03', '2016-04-12 17:25:21.571733+03', '{% load proj_images %}

<p>

    Инженеру <strong>строительного контроля</strong>, осуществляющему контроль за строительством объектов

    жилищно-гражданского и производственного назначения,по основным видам нарушений при производстве <strong>земляных

    работ</strong>.

</p>

<h2>Перечень основных строительных нарушений (дефектов) при производстве земляных работ</h2>

{% with size=''192'' lazy=''canvas'' class=''img-fluid'' lightbox=''stroitelnyj-kontrol'' itemprop=True %}

<table class="table table-condensed">

    <caption>Земляные работы</caption>

    <thead>

    <tr>

        <th width="56">№ <br> п/п</th>

        <th>Нарушения обязательных требований нормативных документов в строительстве</th>

        <th width="16.667%">Ссылки на нормативные документы</th>

        <th width="16.667%">Контролируемые параметры</th>

        <th width="16.667%">Предельные отклонения</th>

        <th width="25%">Фото (образец нарушения)</th>

    </tr>

    </thead>

    <tbody>

    <tr>

        <td>1</td>

        <td>Земляные сооружения, основания и фундаменты не соответствуют проекту и выполняются с отклонениями от проекта

            производства работ.

        </td>

        <td>СП 45.13330.2012 п.&nbsp;4.3 (СНиП 3.02.01-87, п.&nbsp;1.7)</td>

        <td></td>

        <td></td>

        <td>

            {% with alt=''земляные сооружения, основания и фундаменты не соответствуют проекту'' %}

            {% thumb ''www/stroitelnyj-kontrol/4/00.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>2</td>

        <td>Замена предусмотренных проектом грунтов, материалов, изделий и конструкций, входящих в состав возводимого

            сооружения или его основания произведена без согласования с проектной организацией и заказчиком.

        </td>

        <td>СП 45.13330.2012 п.&nbsp;4.6 (СНиП 3.02.01-87, п.&nbsp;1.8)</td>

        <td></td>

        <td></td>

        <td></td>

    </tr>

    <tr>

        <td rowspan="15">3</td>

        <td rowspan="15">Не выполняются нормативные требования по водопонижению, организации поверхностного стока и

            водоотвода

        </td>

        <td rowspan="15">СП 45.13330.2012 п.&nbsp;5.1-п.&nbsp;5.53, (СНиП 3.02.01-87, п.&nbsp;2.1.-п.&nbsp;2.19)</td>

        <td></td>

        <td></td>

        <td rowspan="11">

            {% with alt=''нормативные требования по водопонижению, организации поверхностного стока и водоотвода'' %}

            {% thumb ''www/stroitelnyj-kontrol/4/01.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr class="noborder">

        <td>1.&nbsp;Контрольное давление воды при проверке герметичности системы трубопроводов</td>

        <td>Выше расчетного значения не менее чем на 50%</td>

    </tr>

    <tr>

        <td>2.&nbsp;Уклон трубопроводов иглофильтровых установок:</td>

        <td>Не менее:</td>

    </tr>

    <tr class="noborder">

        <td>всасывающих:</td>

        <td>0.005 от насоса;</td>

    </tr>

    <tr class="noborder">

        <td>напорных распределительных:</td>

        <td>0.001 от насоса;</td>

    </tr>

    <tr class="noborder">

        <td>водосборных:</td>

        <td>0.005 в сторону циркуляционного бака;</td>

    </tr>

    <tr>

        <td>3.&nbsp;Фильтры водопонизительных скважин:</td>

        <td>Не допускаются обрывы нитей, неплотные стыки, трещины и др.;</td>

    </tr>

    <tr>

        <td>4.&nbsp;Отклонение продольного уклона водоотводных канав от проектного значения:</td>

        <td>Не более &plusmn;0,0005;</td>

    </tr>

    <tr>

        <td>5.&nbsp;Концентрация химических веществ и взвесей в воде, сбрасываемой в естественные водотоки и водоемы:

        </td>

        <td>Не более предельно допустимых концентраций, установленных проектом;</td>

    </tr>

    <tr>

        <td>6.&nbsp;Контроль работы водопонизительных установок:</td>

        <td>По данным заводского паспорта на оборудование и проекта;</td>

    </tr>

    <tr>

        <td>7.&nbsp;Контроль за положением статического и динамического уровней воды в скважинах:</td>

        <td>Согласно проекта;</td>

    </tr>

    <tr>

        <td>8.&nbsp;Отклонения уклона спланированной поверхности от проектного, кроме орошаемых земель:</td>

        <td>Не должны превышать &plusmn;0.001 при отсутствии замкнутых понижений;</td>

        <td rowspan="4">

            {% with alt=''состояние откосов и дна котлованов и траншей'' %}

            {% thumb ''www/stroitelnyj-kontrol/4/02.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    <tr>

        <td>9.&nbsp;Отклонения отметок спланированной поверхности от проектных, кроме орошаемых земель:</td>

        <td></td>

    </tr>

    <tr class="noborder">

        <td>а)&nbsp;в нескальных грунтах:</td>

        <td>&plusmn;5 см;</td>

    </tr>

    <tr class="noborder">

        <td>б)&nbsp;в скальных грунтах:</td>

        <td>От +10 до -20 см;</td>

    </tr>

    <tr>

        <td>4</td>

        <td>Восполнение переборов в местах устройства фундаментов и укладки трубопроводов выполнено непроектным грунтом,

            без уплотнения до плотности грунта естественного сложения

        </td>

        <td>СП 45.13330.2012 п.&nbsp;6.1.8 (СНиП 3.02.01-87, п.&nbsp;3.8)</td>

        <td></td>

        <td></td>

        <td>

            {% with alt=''места устройства фундаментов и укладки трубопроводов'' %}

            {% thumb ''www/stroitelnyj-kontrol/4/03.jpg'' %}

            {% endwith %}

        </td>

    </tr>

    </tbody>

</table>

{% endwith %}', 1, 1, 1);


