INSERT INTO proj_postbox VALUES (4, 'DenisPlat', 'dermsdkoepoapsl@mail.ru', '', 'Attention Abuse on site: Нужна помощь чтобы припугнуть админа', 'Attention Abuse on site: 

Купил у админа два года назад вечную ссылку. Вечное размещение подразумевало размещение ссылки навсегда. Спустя 2 года страница со ссылкой была удалена. Админ говорит, что деньги были возвращены на баланс в бирже где я покупал ссылку, но доступы у меня туда утеряны, и я не могу забрать свои деньги. Я потребовал вернуть мне деньги напрямую на кошелек, но получил отказ. 

Я прошу мне помочь. Что нужно от Вас: 

1. Направить на сайт http://music.utrolive.ru/ жалобы 

2. Направить владельцу сайта письмо. Пригрозить ему и потребовать выплатить мне компенсацию в $$$, иначе грозить отправлять жалобы каждый день. 

При хорошем натиске им будет проще вернуть деньги и заплатить компенсацию. Моя почта для связи: denisplatinov1997@mail.ru буду рад любой помощи.', '2016-03-17 12:36:15.456265+03', NULL, NULL, NULL, 1);
INSERT INTO proj_postbox VALUES (5, 'Velmeino', 'sales@sunlightsailing.eu', '', 'Уникальное путешествие на парусной яхте', 'Напоминаем, что майские каникулы не за горами и еще есть места на наших лодках для участие в походе который состоится в период майских праздников с 30 апреля по 13 мая. Подробнее о походе на сайте SunLights Sailing.ru 

Можно просто отдохнуть под парусом, а  можно и поучиться,  и при успешной сдаче экзамена получить сертификат ISSA Coastal (Inshore) Skipper http://issa-schools.org/issa-training/sail-training/inshore-skipper/ , позволяющий брать яхту в чартер в любой акватории мира. 

Цена участия в двухнедельном походе на наших лодках, c человека: 

Круиз            -  1000 Евро 

Обучение на уровень ISSA Coastal (Inshore) Skipper http://issa-schools.org/issa-training/sail-training/inshore-skipper/  -   1200 Евро. 

При успешной сдаче экзамена сертификат оплачивается отдельно -   155 Евро. 

В стоимость входит размещение в двухместной каюте, аренда лодки, топливо, стоянки, сборы, участие в культурной программе. Не входят: Перелет, питание, трансфер. 

Возможно одноместное размещение + 75% от стоимости круиза. 

Мы идем на лодках: Bavaria 49/2004 (5 двухместных кают) http://sunlightsailing.ru/catalog/yakhty/Bavaria49-5Cab-2004/ 

и Oceanis 461/2000 (4 двухместные каюты) http://sunlightsailing.ru/catalog/yakhty/Oceanic-461-4cab-2000/. 

Мы стартуем из Афин, пройдем вокруг полуострова Пелопоннес, посетив много легендарных мест, заглянем на родину Одиссея остров Итака и вернемся в Афины, пройдя через знаменитый Коринфский канал. Общая протяженность маршрута, около 500 морских миль. 

Участие возможно в двух вариантах: 

- На наших лодках, выкупив одно или несколько мест для себя и своих друзей 

- На своих или взятых в чартер лодках. Присоединившись к нашей флотилии. 

Так как Греция ? страна Евросоюза, участникам потребуется Шенгенская Виза. Однако мы предоставим все документы для облегчения ее оформления. 

Подать заявку можно на сайте http://sunlightsailing.ru/services/pokhody_kruizy/mayskie-kanikuly-v-gretsii/ или по е-майлу: office@sunlightsailing.ru.', '2016-03-18 09:25:49.513194+03', NULL, NULL, NULL, 1);
INSERT INTO proj_postbox VALUES (6, 'Velmeino', 'sales@sunlightsailing.eu', '', 'Уникальное путешествие на парусной яхте', 'Напоминаем, что майские каникулы не за горами и еще есть места на наших лодках для участие в походе который состоится в период майских праздников с 30 апреля по 13 мая. Подробнее о походе на сайте SunLights Sailing.ru 

