INSERT INTO proj_postbox VALUES (90, 'Оксана', 'renovio_rus@mail.ru', '+7(495) 988-59-41 +7(916) 240-55-86', 'Сотрудничество', '<p>Добрый день! Предлагаем Вашему вниманию новинку на российском рынке. Жидкая пленка Liquick – временная защита стекла, алюминия, ПВХ, стали, и других непористых поверхностей. <br>Вместо СТРЕЙЧ пленки и скотча! Применяется при строительных, монтажных работах, при ремонте, <br>установке окон, светопрозрачных конструкций. Защищает от механических повреждений, <br>от искр болгарки и сварки пыли, грязи, цемента и пр. Наносится на поверхность с помощью валика или распылителя. <br>После высыхания образуется защитная плёнка. На водной основе, не токсичен, не горит. <br>После окончания работ просто снимается руками, остатки смывается тёплой водой. <br>Наносится как краска - снимается как пленка! Продается в пластиковых в ведрах по 5, 10, 20 л. <br>В наличии на складе. <br>О компании: <a href="https://vk.com/away.php?to=http%3A%2F%2Frenovio-rus.ru%2F" target="_blank">http://renovio-rus.ru/</a> Компания Реновио Рус является производителем и продавцом Жидкой пленки Liquick. С 2010г. на рынке РФ.</p>', '2016-09-21 11:05:57.411279+03', NULL, NULL, NULL, 1);
