INSERT INTO proj_postbox VALUES (92, 'Митин Илья', 'ilya_mitin_94@mail.ru', '8-965-167-89-59', 'Трудоустройство в ГК "ССК"', '<p>    Здравствуйте! Меня зовут Илья. Мне 22 года. В 2016 году окончил НАЦИОНАЛЬНЫЙ ИССЛЕДОВАТЕЛЬСКИЙ МОСКОВСКИЙ ГОСУДАРСТВЕННЫЙ СТРОИТЕЛЬНЫЙ УНИВЕРСИТЕТ (НИУ МГСУ) до 1993 года МИСИ им. В.В. Куйбышева. Направление: Промышленное и Гражданское Строительство  (ПГС). За время обучения получил много знаний в таких направлениях как: технология и организация строительного производства; технология возведения зданий и сооружений; проектирование и расчет металлических, железобетонных и каменных конструкций;  испытания зданий и сооружений. Разрабатывал ППР, а также технологические карты на монолитные, фасадные, кровельные работы. Свободно владею ПК(AutoCAD, Word<strong>, </strong>Excel, СКАД, ЛИРА) и др.</p>  <p>    Опыт работы получил на производственной практике, а именно в ЗАО "Строительно-монтажный поезд №250" в городе Коломна. Возводился 15-ти этажный монолитный жилой дом. На строительной площадке работал помощником главного прораба. Организовывал и контролировал работу бригад кровельщиков и каменщиков; вел журналы производства работ, ТБ и ОТ; составлял акты скрытых работ; принимал строительные конструкции и материалы. Опыт: 4 месяца. </p>  <p>   Личные качества: ответственность, пунктуальность, активность, целеустремленность, исполнительность, аккуратность, оперативность, организованность. Без вредных привычек. Хобби: занимаюсь футболом и хоккеем. С огромным желанием приступлю к работе!!!</p>  <p>Моб. тел: 8-965-167-89-59</p>', '2016-10-06 12:44:43.380869+03', NULL, NULL, NULL, 1);
