INSERT INTO proj_postbox VALUES (225, 'RoombikWalt', 'roombik55up9@mail.ru', '', 'Компания iRobot добавила пылесосам Roomba 980  систему визуального картографирования и навигации. Видео обзор', 'IRobot Roomba 980 стал самым революционным продуктом компании iRobot, несомненно очень приятно видеть так много современных технологий в этом роботе-пылесосе. «Это наш наиболее совершенный робот, с тех пор как компания выпустила первый пылесос Roomba», - сказал Колин Энгл, один из основателей iRobot, генеральный директор компании, на пресс-конференции в Нью-Йорке. «Он по-прежнему круглый, по-прежнему отличный уборщик, но это совершенно новый робот».  
 
