INSERT INTO proj_postbox VALUES (382, 'Claytonbib', 'evveselova1987@rambler.ru', '', 'Знайте, что частные клиники могут обслуживать вас почти даром', 'Имеется такая услуга - добровольное медицинское обслуживание (или ДМО). 
Она предполагает, что пациент вносит небольшую сумму за то, что посещает врачей весь год БЕСПЛАТНО. 
Однако соцопросы показали, что лишь 6% жителей Санкт-Петербурга знают о ее существовании. 
Почему? 
Потому что частным клиникам намного выгодней брать плату за каждое посещение. 
А если какой-нибудь сотрудник клиники посоветует добровольное медицинское обслуживание клиенту - это сулит ему увольнением. 
Эта информация уже спровоцировала множество возмущений, сразу после того как информацию об услуге распространил один  врач. 
Его уволили "по собственному желанию", после того, как он предложил ДМО своему пациенту. 
Самое ужасное, что официальные положения по ДМО есть в открытом доступе, просто натыкались на эту информацию только случайные люди. 
Как отстоять свои права? 
О правилах предоставления услуги и обязанностях частных клиник можно узнать, просто вбив в Яндекс фразу: "добровольное медицинское обслуживание". 
И именно обслуживание, а не страхование. 
 
34j5c6h86', '2017-03-06 03:41:42.121322+03', NULL, NULL, NULL, 1);
