INSERT INTO proj_postbox VALUES (474, 'Donaldlex', 'edfrolova1990@rambler.ru', '', 'Как быть, если ребенок заболел?', 'Мало заботиться о состоянии здоровья родного малыша - надо делать решительные действия для его защиты. Притом поручить этот вопрос можно только лишь опытным проверенным педиатрам. 
На сегодняшний день помощь личного доктора по карману далеко не всем гражданам Нашей страны. А отправляться по каждому вопросу в поликлинику, выстаивать долгие очереди и подвергать чадо вероятности заразиться вирусами от иных детей - тоже не вариант. 
К счастью, многие частные клиники дают оформить программу Детского Добровольного Медицинского Обслуживания (ДМО), которая даёт возможность за небольшую сумму получить полис на годовое обслуживание у врачей. 
К сожалению, не многие люди знают о данной услуге и продолжают лечить детей народными способами, ждут часами в очередях и отдают большие деньги за посещения частных докторов. 
А программа Добровольного Медицинского Обслуживания для детей позволяет: 
"	Бесплатно получить больничный лист по уходу за ребенком; 
"	Бесплатно обследоваться у индивидуальных врачей педиатров; 
"	Бесплатно или со скидкой осуществлять лечебные процедуры и диагностические процедуры; 
"	Лечить ребенка сразу, качественно и без очередей. 
Чтобы ознакомиться со списком клиник и условиями предоставления лечения нужно написать в поиск Яндекса или Google фразу: "Добровольное Медицинское Обслуживание". После этого нужно выбрать понравившуюся клинику и оформить договор. 
 
