INSERT INTO proj_postbox VALUES (496, 'GicleeRok', 'smellofskyr@mail.ru', '', 'Understanding Giclee Prints', 'Good day! 
 
Understanding Giclee Prints for avant-garde home wall decor. 
 
Giclee (zhee-klay) - The French word "giclee" is a feminine word that means a spray of liquid. The word may have been derived from the French verb "gicler" meaning "to squirt". 
 
Images are generated from high resolution digital scans and printed with archival quality inks onto different substrates including canvas and fine art paper.  
 
https://en.wikipedia.org/wiki/Gicl%C3%A9e -  Giclee is a neologism coined in 1991 by printmaker Jack Duganne for fine art digital prints made on inkjet printers. The name originally applied to fine art prints created on Iris printers in a process made-up in the late 1980s but has since come to mean any inkjet print. It is usually used by print shops to suggest high quality printing.  
 
Giclee prints are advantageous to artists who do not find it suitable to mass produce their work, but want to reproduce their art as needed. 
 
Numerous examples of giclee prints can be found in New York City at the http://www.metmuseum.org/ - Metropolitan Museum, the http://www.metmuseum.org/ - Museum of Modern Art and the http://chelseagallerymap.com/ - Chelsea Galleries. Recent auctions of giclee prints have fetched $10,800 for Annie Leibovitz, $9,600 for Chuck Close, and $22,800 for Wolfgang Tillmans.  
 
https://www.etsy.com/il-en/listing/512632271/giclee-art-print-n-31-contemporary-art -  Herу and now you can order authentic Giclee original art at Etsy shops. 
 
