INSERT INTO proj_postbox VALUES (512, 'Richardemurn', 'miveselova1995@rambler.ru', '', 'Где лечить ребенка?', 'Мало волноваться о здоровье родного малыша - нужно делать решительные действия для его защиты. Притом поручить данный вопрос нужно только опытным профессиональным педиатрам. 
На сегодняшний день консультации персонального врача по карману далеко не многим гражданам РФ. А ходить по любому вопросу в поликлинику, отстаивать долгие очереди и подвергать чадо риску заразиться вирусами от других детей - тоже не вариант. 
К счастью, многочисленные частные клиники дают оформить программу Детского Добровольного Медицинского Обслуживания (ДМО), которая позволяет за несущественную сумму приобрести полис на одногодичное обслуживание у педиатров. 
К сожалению, не многие люди осведомлены о данной услуге и продолжают лечиться народными способами, ждут длительное время в очередях и переплачивают за посещения частных педиатров. 
А программа Добровольного Медицинского Обслуживания для детей позволяет: 
"	Бесплатно получить больничный лист по уходу за ребенком; 
"	Бесплатно проходить обследование у индивидуальных врачей педиатров; 
"	Бесплатно или со скидкой проходить лечебные процедуры и диагностические процедуры; 
"	Лечить ребенка вовремя, качественно и без очередей. 
Для того чтобы ознакомиться со списком клиник и условиями оказания лечения нужно написать в поиск Яндекса или Google ключевое выражение: "Добровольное Медицинское Обслуживание". После этого необходимо выбрать понравившуюся клинику и оформить договор. 
 
