INSERT INTO proj_postbox VALUES (827, 'Liluunasor', 'kara.b.u.nbab.arun.m.a.runah@gmail.com', '', 'как считать ежемесячный платеж по кредиту', 'Вопросец о распространенности подобной диковины на рынке опять вызвал противоречия. Ира Кажикина («Релайт-Недвижимость») категорически заявила, что информация устаревшая: подобные фокусы были распространены до кризиса 2008 года, но на данный момент их нет. А в пресс-службе Сбербанка напомнили, что банк контролирует не только лишь сумму, обозначенную в отчете об оценке, да и в договоре купли-продажи. Прочие эксперты оказались наиболее аккуратными в оценках: самым частым ответом оказалось «нечасто, но бывает».

Примечательно, что с инициативой «приукрасить» отчет к заемщику иногда обращаются сами оценщики: мол, давайте нам 3000 рублей, и мы нарисуем вам красиво. Банки, конечно, фильтруют оценочные компании, с которыми работают. «Отчет от заемщика предоставляется только от аккредитованной банком оценочной компании, - говорит Сергей Ситин, начальник управления розничного кредитования Промсвязьбанка. – Аккредитация означает, что банк проверил деятельность компании, в том числе и ее репутацию, и доверяет ей определять цена закладываемого в банк неподвижного имущества. Оценочные компании, обычно, дорожат своей репутацией и стараются не допускать предоставление недостоверных данных своим партнерам».

И все таки такое случается. Общение потенциального заемщика происходит совсем не с руководителем восхитительной аккредитованной компании, а с рядовым исполнителем, и о чем они там условятся – бог весть.

А самое любознательное – дальнейшая судьба отчета. Дело в том, что необходимость в нем – требование закона «Об ипотеке», и банку такой документ не особенно-то нужен. Поэтому, получив отчет о оценке (с любыми цифрами – хоть действительными, хоть завышенными), банк традиционно оценивает квартиру своими силами. Проще говоря, его сотрудник открывает базу данных по продажам квартир и находит там самые дешевые из подобных вариантов. И в завышении цены отказывает. Так что отлично и банку (знает настоящую стоимость собственного залога), и оценщику (получил дополнительный «гонорар»). Не чрезвычайно отлично, правда, заемщику – издержал 3000 руб. совершенно зря. Но не нужно было взятку давать!
