Скидка до 3500/кв.м. либо кладовая в подарок. Квартиры от 1,3 млн руб. Горьковское ш. Окончание строительства 2017 г от 1,3 млн руб. Узнать телефон

Потребительский кредит под видом ипотечного
Банковских товаров существует масса – о этом сегодня малыши малые знают. И также всем понятно, чем ипотечные кредиты лучше всех прочих – они одни из самых прибыльных для заемщика. И ставки минимальные (по сравнению с прочими), и сроки самые длинные. Поэтому те граждане, которым необходимы просто средства (т.е. потребительский кредит), пробуют получить ипотечный.

Рассказывая об этой теме, почти все банки выразили искреннее недоумение: вот у нас есть нецелевые кредиты под залог имеющейся недвижимости, таким методом совершенно легально можно получить средства на что угодно! Это, конечно, правда, относительно этих продуктов справедливо все то, что сказано абзацем выше – средств дадут меньше и под условия похуже. Потому стимул получить кредит якобы на приобретение недвижимости все-же существует.

«Ситуация чрезвычайно редчайшая, - говорит Марина Мишурис (ФлексБанк). – Вспоминается только один подобный случай. Тогда продавец и покупатель, как выяснилось, были в родственных отношениях – и появилось подозрение, что сделка купли-продажи по сути фиктивная, а деньги будут использованы на личные цели. Кредит в результате выдан не был, и проверить эту догадку эмпирически не удалось. А вообще, отсутствие схожих отношений является обязательным условием для ипотечного кредита». «С таковыми случаями мы не сталкивались», - подтверждает Лена Ковырзина, директор департамента кредитования розничного бизнеса и МСБ Абсолют Банка. Совместно с тем эксперт соглашается, что если представить, что обладатель квартиры и «покупатель» условились таким образом обмануть банк и получить дешевенький кредит, отследить эту схему тяжело. Хотя в данном случае у банка остается залог, на который в случае просрочки по кредиту можно обратить взыскание

