<b>Жанр или тематика</b>: Роман 
 
<b>Издательство</b>: Афіша 
<b>ISBN</b>: 978-966-325-224-7 
<b>Язык</b>: Украинский 
 
<b>Формат</b>: PDF 
<b>Качество</b>: Издательский макет или текст (eBook) 
<b>Количество страниц</b>: 454 
 
<b>Описание</b>: Женщина, изменяя мужу, получает удовольствие. Ему же достается этот грех, невыносимая боль унижения его мужского достоинства. Желание избавиться от него, человек творит подвиги чтобы утолить, забыть этот грех, подняться над ним. Но напрасно: вся его жизнь горчит тем грехом и все его старания и подвиги тонут в слащавом греху женской измены. Такой сюжет романа «Сладкий грех, или анатомия измены». Это вторая книга Львовского автора Олега Рыбчинского и она является продолжением любовно-исторического романа «Черные морели». События и герои реальные, только из морально-этических соображений их имена изменены. 
 
