INSERT INTO proj_postbox VALUES (1062, 'Thailandi-dow', 'user1@bazatver.ru', '', 'полет гиббона в паттайе', 'Тайланд – красивая страна, притягивающая отдыхающих своей восхитительной флорой и фауной. На западе страны возвышается остров Пхукет, на который прибывает основная масса отдыхающих. Главное достоинство этого курорта это Андаманское море, с прозрачной водой, теплая, насыщенного бирюзового оттенка. 
Самые популярные пляжи это Патонг и Камала. Для детского отдыха больше подойдет побережье Камала, поскольку он менее людный и шумный, рядом с ним тихо и спокойно. А пляж Патонг не такой уж спокойный, здесь работают торговые павильончики, дискотеки и клубы, но зато добраться сюда очень просто. Стоит отметить, что на обоих пляжах нет навязчивых торговцев, помоек, гальки и камней, что делает отдых более комфортным. 
Достопримечательностей на острове Пхукет не так много, всего несколько храмов. Из развлечений можно отметить дайвинг с аквалангом, позволяющее увидеть разнообразие подвожного мира. Также остров знаменит экскурсионными турами: заповедники Као Лак и Као Сок, джип-сафари, прогулка на слоне, это все не оставит равнодушным ни одного туриста. Наилучшее время для путешествия – октябрь - апрель, в это время наиболее солнечно и температура более приятная. 
 
Паттайя - шумные вечеринки 
 
Курорт Паттайя по популярности не уступает Пхукету, но сильно отличается от него. Вода в море на центральных пляжах Паттайи весьма грязная с мутной зеленоватой водой, однако рядом есть несколько островов, где вода безупречно чистая. Добраться туда можно на морском паромчике, дорога займет времени примерно час в одну сторону. Но не смотря на все все пляжи в Паттайе битком людей, сложно будет найти пустой лежак, в воде почти никто не плавает, все туристы только принимают солнечные ванны. 
В отличие от Пхукета- Паттайя богата достопримечательностями. Наиболее популярные и массовые это храм Большого Будды и храм Истины. Кроме старинных исторических шедевров, нужно обратить внимание на крокодиловую и слоновью фермы. Но самое важное, чем прославилась Паттайя – шумные тусовки. Удивительная улица «красных фонарей» современная визитная карточка города. В каждом доме здесь клубы, рестораны, развлекательные мероприятия под открытым небом, шоу ледибоев и пр. 
Любителям шоппинга здесь понравится больше, чем на Пхукете, благодаря тому, что здесь очень много шоппинг центров. Что касается продуктов, особенно фруктов, на Паттайе цены дешевле, а качество ничем не отличаются. 
 
Отдых в Тайланде впечатляет всех людей на каждом курорте, это та самая страна, которую стоит обязательно посетить. 
