INSERT INTO proj_postbox VALUES (1431, 'Дарья Мальцева', 'msk9@svok.com', '+7 977 729 96 01', 'Сотрудничество в сфере поставок вентиляционного оборудования "СВОК".', '<p>Добрый день!</p>  <p>Компания «СВОК» является прямым производителем: вентиляционного оборудования (от небольших компактных установок и канальной группы до каркасно-панельных центральных кондиционеров производительностью до 82000 м3/ч ; противопожарных клапанов и вентиляционных решеток; воздуховодов, фасонных частей и деталей систем вентиляции; автоматики и узлов терморегулирования.</p>  <p>По конструктиву мы аналоги Remak,Ned, Korf, Vertro - используем комплектующие ведущих европейских производителей, закупаемых у Техногрупп.</p>  <p>Преимущества сотрудничества с нашей компанией:</p>  <p>1. Сроки производства: центральные установки – 3-6 недель, канальная группа – в наличии на складе, фасонные части, клапана ПП – до 1-й недели;<br> 2. Качество: собственное производство (МО, г. Чехов), сертификаты соответствия, гарантия 3 года с возможностью расширения до 7 лет;<br> 3. Цена: гибкая ценовая политика, система скидок;<br> 4. Собственная транспортная служба, возможность бесплатной доставки по Москве и Московской области;<br> 5. Возможность изготовления оборудования по чертежам заказчика.</p>  <p>Направляю Вам ссылку на сайт завода и каталог: <a href="http://svok.com/oborudovanie/katalog">http://svok.com/oborudovanie/katalog</a></p>  <p>Предлагаю встретиться для более подробной презентации оборудования, передачи каталогов нашей продукции.</p>  <p>По всем вопросам обращайтесь к нам, с удовольствием на них ответим. Надеюсь на взаимовыгодное сотрудничество.</p>        <p>--</p>  <p>С уважением, </p>  <p><strong>Дарья Мальцева</strong></p>  <p>Руководитель проектов.</p>  <p>тел.: +7 499 642-55-45</p>  <p>моб. тел. +7 977 729-96-01</p>  <p>e-mail: <a href="mailto:msk9@svok.com">msk9@svok.com</a>   <a href="http://www.svok.com/">www.svok.com</a></p>    <p><a href="http://www.svok.com/" target="_blank"></a></p>', '2017-09-22 13:06:38.705858+03', NULL, NULL, NULL, 1);
